import unittest
import utils
import base64
import io

from os import remove
from PIL import Image
from exceptions import NoFaceFoundError
from exceptions import TooManyFacesFoundError


class Base64Image(object):
    PHOTO_FACE_01 = ''
    PHOTO_FACE_02 = ''
    PHOTO_FACE_03 = ''
    PHOTO_NO_FACE = ''
    PHOTO_GROUP = ''

    @staticmethod
    def base64_to_bytesIO(data):
        msg = base64.b64decode(data)
        return io.BytesIO(msg)


class TestFindFunction(unittest.TestCase):

    def test_find_face(self):
        result = utils.find_face(Base64Image.base64_to_bytesIO(Base64Image.PHOTO_FACE_01))
        self.assertTrue(result)

    def test_not_finding_face(self):
        self.assertRaises(NoFaceFoundError, utils.find_face, Base64Image.base64_to_bytesIO(Base64Image.PHOTO_NO_FACE))

    def test_too_many_faces(self):
        self.assertRaises(TooManyFacesFoundError, utils.find_face, Base64Image.base64_to_bytesIO(Base64Image.PHOTO_GROUP))


class TestCompareFunction(unittest.TestCase):

    def test_compare_not_same_faces(self):
        result = utils.compare_faces(Base64Image.base64_to_bytesIO(Base64Image.PHOTO_FACE_01), Base64Image.base64_to_bytesIO(Base64Image.PHOTO_FACE_03))
        self.assertFalse(result)

    def test_compare_same_face(self):
        result = utils.compare_faces(Base64Image.base64_to_bytesIO(Base64Image.PHOTO_FACE_01), Base64Image.base64_to_bytesIO(Base64Image.PHOTO_FACE_02))
        self.assertTrue(result)


class TestResizeFunction(unittest.TestCase):

    @classmethod
    def setUpClass(self):
        try:
            remove("./tmp/obama_r.jpg")
        except OSError as error:
            print(error)

    def test_resize(self):
        utils.resize_image("./images/obama.jpg", "./tmp/obama_r.jpg")
        img = Image.open("./tmp/obama_r.jpg")
        self.assertEqual(500, img.height)
        self.assertEqual(400, img.width)


if __name__ == '__main__':
    unittest.main()
